import React from 'react';
import './User.css';
import {Navbar, Container, Nav} from 'react-bootstrap';
import { Link } from 'react-router-dom';
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import KeyRequest from './KeyRequest';
import KeyDownload from './KeyDownload';
import User from './User';

function navBar() {
    return (
        <div>
            <Router>
            <Navbar bg="dark" variant="dark" fixed="sticky">
                <Container>
                    <Navbar.Brand href="http://evolute.in" className="navbarbrand"></Navbar.Brand>
                    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                    <Navbar.Collapse id="responsive-navbar-nav">
                        <Nav className="ml-auto">
                            <Nav.Link to="/User/KeyRequest" copmonent={Link}>Key Request</Nav.Link>
                            <Nav.Link to="/User/KeyDownload" component={Link}>Key Download</Nav.Link>
                        </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar>
            <Switch>
                <Route path="/User/" exact component={User} />
                <Route path="/User/KeyRequest" component={KeyRequest} />
                <Route path="/User/KeyDownload" component={KeyDownload} />
            </Switch>
            </Router> 
        </div>
    )
}

export default navBar;
